import React, { Component } from 'react';
import {Button, Col, Radio} from 'antd';

class User extends Component{

  constructor(){
    super()
  }
  render(){
    return(
      <Radio.Group>
        <Radio.Button value="signin">SignIn</Radio.Button>
        <Radio.Button value="signup">SignUp</Radio.Button>
      </Radio.Group>
    );
  }
}

export default User;
